import React from "react";
import Navigation from "../../components/Navigation";
import Footer from "../../components/Footer";

const Jobvacancy = () => {
    return (
        <>
            <Navigation />
            <section className="container mx-auto px-4 mt-7 space-y-10"></section>
            <Footer />
        </>
    );
};

export default Jobvacancy;
